import React from 'react'
import { Grid, Image } from 'semantic-ui-react'

export default function tumkampanyalar() {
    return (
        <Grid verticalAlign='top' columns={3}>
        <Grid.Row >
          <Grid.Column>
            <Image src='https://react.semantic-ui.com/images/wireframe/image.png' />
          </Grid.Column>
        </Grid.Row>
      </Grid>
    )
}
